import React, { Component } from 'react';
import Header from "./components/Header";
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header/>
        <div className="metamask">
           <i className="fa fa-circle" style={{"color":"red"}}></i>
                   Metamask Unlocked
        </div>
      </div>
    );
  }
}

export default App;
